import Head from 'next/head';

export default () => {
    return (
      <>
        <Head>
          <title></title>
        </Head>
        <Menu />
        <header className="my-header">
          <h1>Test task</h1>
          <h4>My first blog</h4>
        </header>
        <Home />
        <Footer />
      </>
    );
  };
